,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2651779880060787430","edge_media_to_caption":{"edges":[{"node":{"text":"EVERY LEARNER GAINS FROM INDIVIDUALISED INSTRUCTION\n\nEvery educator will tell you that one-to-one instruction is the most effective type of instruction. When the classroom teacher has to control a class of over one dozen unique children, the quality of learning reduces.\n\nWhile some students are fast enough to learn in any kind of environment, many others struggle to follow lessons, Even when the class size is small, teachers struggle to effectively meet the academic needs of each child.\n\nMoreover, there is only so much a classroom teacher can do. Some children find it too embarrassing to ask questions in class. Sometimes they are scared of being humiliated by the teacher or their peers, and so they withdraw into their shell. But when they are alone with the tutor, they are often free to ask questions and to seek clarifications when they are confused."}}]},"shortcode":"CTNA8BNjRrm","edge_media_to_comment":{"count":2},"taken_at_timestamp":1630336817,"dimensions":{"height":905,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240774211_365132298626012_8175319027121610896_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=mwZgIV00bskAX_fhA8X\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_-uOOtjys-0T5_80bglgCc_RlCQ2sJyir7Kjx7myWjuA\u0026oe=62D13C9E\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3},"edge_media_preview_like":{"count":3},"owner":{"id":"6031543669"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/240774211_365132298626012_8175319027121610896_n.jpg?stp=c76.0.788.788a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=mwZgIV00bskAX_fhA8X\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_pA395i0fsdVqCbhCjbV6ZQOCG8ttcGF4Lfud8w0UU6Q\u0026oe